var stopPageLoader = function () {
  setTimeout(function () {
    $("#ftco-loader").removeClass("show");
  }, 2000);
};

var startPageLoader = function () {
  setTimeout(function () {
    $("#ftco-loader").removeClass("show");
  }, 2000);
};

var startImageLoader = function () {
  $(".img-loader").addClass("show");
};

var stopImageLoader = function () {
  setTimeout(function () {
    $(".img-loader").removeClass("show");
  }, 1000);
};

var generateImage = async function (nodeId, downloadButtonId) {
  var node = document.getElementById(nodeId);
  if (node) {
    try {
      var downloadButton = document.getElementById(downloadButtonId);
      const dataUrl = await domtoimage.toPng(node);
      downloadButton.href = dataUrl;
      return dataUrl;
    } catch (err) {
      console.error("oops, something went wrong!", err);
    }
  }

  return false;
};

var themeChanger = (func = () => {}) => {
  let trans = () => {
    document.documentElement.classList.add("transition");
    window.setTimeout(() => {
      document.documentElement.classList.remove("transition");
    }, 1000);
  };

  let onThemeChange = () => {
    window.setTimeout(() => {
      func();
    }, 1000);
  };

  $("#theme").click(function () {
    trans();
    onThemeChange();
    if ($("#theme").is(":checked")) {
      localStorage.setItem("theme-mode", "dark");
      document.documentElement.setAttribute("data-theme", "dark");
    } else {
      localStorage.setItem("theme-mode", "light");
      document.documentElement.setAttribute("data-theme", "light");
    }
  });

  $("#color-list .color").click(function () {
    localStorage.setItem("theme-color", this.id);
    const color = "#" + this.id;
    trans();
    onThemeChange();
    document.documentElement.style.setProperty("--theme-primary", color);
    $(".color").removeClass("active");
    $(this).addClass("active");
  });

  let selectedColor = localStorage.getItem("theme-color");
  if (selectedColor) {
    $("#" + selectedColor).trigger("click");
  }

  let selectedTheme = localStorage.getItem("theme-mode");
  if (selectedTheme && selectedTheme == "light") {
    $("#theme").prop("checked", false);
    document.documentElement.setAttribute("data-theme", "light");
  }
};

var setExperience = function () {
  const joiningDate = new Date(2017, 03, 26);
  const currentDate = new Date();
  const startMonth = joiningDate.getFullYear() * 12 + joiningDate.getMonth();
  const endMonth = currentDate.getFullYear() * 12 + currentDate.getMonth();
  const monthInterval = (endMonth - startMonth);

  const years = Math.floor(monthInterval / 12);
  const months = monthInterval % 12;
  const experience = months ? `${years}.${months}` : years;

  $(".experience-number").text(experience);
};

function readURL({ target }) {
  console.log(target);
  if (target.files && target.files[0]) {
    var reader = new FileReader();

    reader.onload = function (e) {
      $('#profile-img')
        .attr('style', `background-image: url(${e.target.result})`)
    };

    reader.readAsDataURL(target.files[0]);
  }
}

var initScripts = () => {
  themeChanger();
  setExperience();

  $(document).ready(function () {
    stopPageLoader();


    $('#icard').click((e) => e.stopPropagation())

    $('#icard').dblclick(() => {
      $('#icard').attr('contenteditable', 'true')
    })

    $("body").click(() => {
      $('#icard').attr('contenteditable', 'false')
    })

    $('#profile-img-upload').change(readURL);

    $('#download').click(async (e) => {
      e.preventDefault();
      const dataUrl = await generateImage("icard", "download");
      const link = document.createElement('a');
      link.href = dataUrl;
      link.download = "icard.png";
      link.click();
    })
  });
};

(function ($) {
  const includesList = $("include");
  const includes = [];

  $("include").each(function () {
    const url = $(this).attr("src");

    includes.push(
      fetch(url).then((response) => {
        return response.text();
      })
    );
  });

  Promise.all(includes)
    .then((res) => {
      res.forEach((r, i) => {
        includesList[i].innerHTML = r;
      });
      return true;
    })
    .then(() => {
      initScripts();
    });
})(jQuery);
